import BlogList from "./BlogList";

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The Traveling Blog</h1>
      <div className="links">
        <a href="/">Home</a>
        <a href="/create">New blog</a>
      </div>
    </nav>
  );
};

export default Navbar;
